$(function () {

    /**
     * NavBar - fixed position on scroll
     */
    $(window).scroll(function () {
        var navBar = $(".navbar"),
            height = navBar.height(),
            scrollTop = $(window).scrollTop();

        if (scrollTop > 2) {
            navBar.addClass('reduce');
        } else if (scrollTop < 2) {
            navBar.removeClass('reduce');
        }
    });

});

$(function () {

    /**
     * Bootstrap tooltips
     */
    $('[data-toggle="tooltip"]').tooltip();

});
$(function () {

    /**
     * Main Menu Toggle
     * @js-toggle-menu
     */
    var mainMenu = $("#js-toggle-menu");

    $(mainMenu).click('on', function (e) {
        e.preventDefault();
        alert("Not yet available");
    });

});

$(function () {

    /**
     * Declare Packery Container and FlexSlider Selectors
     * @type {*|jQuery|HTMLElement}
     */

    var $container = $("#container"), $slider = $(".flexslider");

    // Init Sliders
    $slider.flexslider({animation: "slide", smoothHeight: true});

    // Init Packery Like this, according to docs
    var $container = $container.packery({
        itemSelector: '.col-md-4'
    });

    /**
     * Load images when ready, use packery to create masonry layout
     * @type {*|jQuery}
     */
    $container.imagesLoaded()
        .always(function (instance) {
            console.log('All images loaded');
            initPackery();
        }).done(function (instance) {
            console.log('All images successfully loaded');
            initPackery();
        }).fail(function () {
            console.log('all images loaded, at least one is broken');
            initPackery();
        }).progress(function (instance, image) {
            var result = image.isLoaded ? 'loaded' : 'broken';
            console.log('image is ' + result + ' for ' + image.img.src);
            initPackery();
        });

    /***
     * Init Packery Layout
     */
    function initPackery() {
        $container.imagesLoaded(function () {
            $container.packery({
                itemSelector: '.col-md-4'
            });
        });
    }
});
$(function(){

    // Init Facebook API
    // ---------------------------------
    window.fbAsyncInit = function () {
        FB.init({
            appId: '1494901577406443',
            xfbml: true,
            version: 'v2.3'
        });
    };

    (function (d, s, id) {
        var js, fjs = d.getElementsByTagName(s)[0];
        if (d.getElementById(id)) {
            return;
        }
        js = d.createElement(s);
        js.id = id;
        js.src = "//connect.facebook.net/en_US/sdk.js";
        fjs.parentNode.insertBefore(js, fjs);
    }(document, 'script', 'facebook-jssdk'));


    // Init Twitter API
    // ---------------------------------
    window.twttr = (function (d, s, id) {
        var js, fjs = d.getElementsByTagName(s)[0],
            t = window.twttr || {};
        if (d.getElementById(id)) return t;
        js = d.createElement(s);
        js.id = id;
        js.src = "https://platform.twitter.com/widgets.js";
        fjs.parentNode.insertBefore(js, fjs);

        t._e = [];
        t.ready = function (f) {
            t._e.push(f);
        };

        return t;
    }(document, "script", "twitter-wjs"));


    // Meta Items - Share buttons
    // ---------------------------------
    var twitterShare = $('.twitter-share'),
        facebookShare = $('.facebook-share');

    $(twitterShare).click('on', function(e){
        e.preventDefault();
        shareContent($(this).closest('.box'), 'twitter'); // Pass container share was clicked in
    });

    $(facebookShare).click('on', function(e){
        e.preventDefault();
        shareContent($(this).closest('.box'), 'facebook'); // Pass container share was clicked in
    });
});


/**
 * shareContent(container)
 *
 * Takes content from box it was shared on. Useful because its listings.
 * @param container
 */
function shareContent(container, type){

    // Store raw values to later check if undefined/empty
    var postImg = $(container).find('.slick-slides').find('.post-thumb').find('img').attr('src'),
        vidImg = $(container).data('src');

    // Create object to neatly store titles, images, links.
    var shareInfo = {

        link: $(container).find('.entry-title').find('a').attr('href'),
        name: $(container).find('.entry-title').find('a').html(),
        image : (function checkImage() {

            if (postImg === undefined) {
                return 'https://img.youtube.com/vi/' + vidImg + '/hqdefault.jpg';
            } else if (!vidImg) {
                return 'http:' + postImg;
            } else {
                // @TODO: Specify default meta image
                return 'http:' + postImg;
            }

        })()
    };


    switch (type) {
        case 'facebook':
            // Insert object values into FB.ui feed dialogue
            FB.ui(
                {
                    method: 'feed',
                    name: shareInfo.name,
                    caption: shareInfo.name,
                    picture: shareInfo.image,
                    link: shareInfo.link
                },

                function (response) {
                    // @TODO: Catch errors, and/or say thanks on success!
                });
            break;
        default:
    }

}

var players = {}; // All players on the page

$(function () {
    $('.play-video').hover(
        function () {
            var iframeID = $(this).find('iframe').attr('id');
            playYouTubeVideo(iframeID);
        },
        function () {
            var iframeID = $(this).find('iframe').attr('id');
            pauseYouTubeVideo(iframeID);
        }
    );
});

/***
 * YouTube API call
 */
function onYouTubePlayerAPIReady() {
    $('iframe').each(function (event) {
        var iframeID = $(this).attr('id');
        players[iframeID] = new YT.Player(iframeID);
    });
}

/***
 * Play Video
 * @param iframeID
 */
function playYouTubeVideo(iframeID) {
    players[iframeID].playVideo();
    players[iframeID].mute();
}

/***
 * Pause Video
 * @param iframeID
 */
function pauseYouTubeVideo(iframeID) {
    players[iframeID].pauseVideo();
}
